import React, { useState } from "react";
import { Link } from "react-router-dom";
// import axios from "axios";
// import { useNavigate } from "react-router-dom";

const Index = () => {
  return (
    <div>
        <div className="container">
            <div className="row">
                <div className="col-md-3 bg-danger">
                    <div className="row">
                        <div className="col-md-1">
                            <i className="fa fa-angle-left grape"></i>
                        </div>
                        <div className="col-md-11 text-center grape">
                            @wdalm
                        </div>
                    </div>
                    <div className="col-md-12">
                        <img src={require("../assets/image/profile1.png")} alt="profile" 
                        className="img-fluid rounded-4"
                        width={65}
                        height={65}
                        />
                    </div>
                    <div className="col-md-12">
                        <h5 className="">Wahyu Dalmia</h5>
                    </div>
                    <div className="col-md-12">
                        <p className="text-muted">@wdalm</p>
                    </div>
                    <div className="col-md-12">
                        <h6>Account</h6>
                    </div>
                    <div className="col-md-12">
                        <p>+375(29)9638433</p>
                        <small>Tap to change phone number</small>
                    </div>
                </div>
                <div className="col-md-8 bg-warning">
                </div>
            </div>
        </div>
    </div>
  );
};
export default Index;
